import { connect } from "react-redux";
import MainCounter from "../components/styled-components/MainCounter"
import { countdown } from "../redux/actions"

const mapState = state => ({
    is_game_started: state.is_game_started,
    is_game_loading: state.is_game_loading,
})

export default connect(mapState)(MainCounter);
